import React from "react";
import { Link } from "react-router-dom";
function Navbar() {
  return (
    <>
      <nav className="Navbar">
        <Link to="/" className="navbar-logo">
          hi
        </Link>
      </nav>
    </>
  );
}
export default Navbar;
